import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => (
  <header style={headerStyle}>
    <div style={brandContainer}>
      <img
        src="/assets/GFX_logo.jpg"
        alt="Millennial GFX Logo"
        style={logoStyle}
      />
      <span style={brandText}>Millennial GFX</span>
    </div>

    <nav style={navStyle}>
      <Link to="/" style={navLink}>Home</Link>
      <Link to="/about" style={navLink}>About</Link>
      <Link to="/services" style={navLink}>Services</Link>
      <Link to="/portfolio" style={navLink}>Portfolio</Link>
      <Link to="/contact" style={navLink}>Contact</Link>
    </nav>
  </header>
);

// Styles
const headerStyle = {
  backgroundColor: '#0a0a36',
  padding: '16px 32px',
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
};

const brandContainer = {
  display: 'flex',
  alignItems: 'center',
  gap: '10px',
};

const logoStyle = {
  width: '36px',
  height: '36px',
  objectFit: 'cover',
  borderRadius: '4px',
};

const brandText = {
  color: '#fff',
  fontSize: '1.3rem',
  fontWeight: 'bold',
};

const navStyle = {
  display: 'flex',
  gap: '24px',
};

const navLink = {
  color: '#fff',
  textDecoration: 'none',
  fontWeight: '500',
};

export default Header;
